export default function* genUint16(prng) {
	for (const x of prng) {
		yield (x >>> 0) & 0xffff;
		yield (x >>> 16) & 0xffff;
	}
}

export default function* genUint64(prng) {
	while (true) {
		yield [prng.next().value, prng.next().value];
	}
}

import fill from './fill';
import nextFloat64 from './nextFloat64';
import nextInt32 from './nextInt32';
import nextUint64 from './nextUint64';
import splitmix64 from './splitmix64';
import xoroshiro128plus from './xoroshiro128plus';

/* eslint import/no-anonymous-default-export: [2, {"allowObject": true}] */
export default {
	fill,
	nextFloat64,
	nextInt32,
	nextUint64,
	splitmix64,
	xoroshiro128plus,
};

export {fill, nextFloat64, nextInt32, nextUint64, splitmix64, xoroshiro128plus};

import nextBigUint64 from './nextBigUint64';

export default function nextBigInt64(prng) {
	return nextBigUint64(prng) - BigInt(2 ** 63);
}

export default function nextBigUint64(prng) {
	const a = prng.next().value;
	const b = prng.next().value;
	return BigInt(a) * BigInt(2 ** 32) + BigInt(b);
}

export default function nextFloat32(prng) {
	const x = prng.next().value;
	return (x >>> 9) / 2 ** 23;
}

export default function nextFloat64(prng) {
	const a = prng.next().value;
	const b = prng.next().value;
	return (a >>> 0) / 2 ** 32 + (b >>> 0) / 2 ** 64;
}

export default function nextInt32(prng) {
	return prng.next().value;
}

export default function nextUint16(prng) {
	return (prng.next().value >>> 16) & 0xffff;
}

export default function nextUint32(prng) {
	return prng.next().value >>> 0;
}

export default function nextUint64(prng) {
	return [prng.next().value, prng.next().value];
}

export default function nextUint8(prng) {
	return (prng.next().value >>> 24) & 0xff;
}

import {add64, mul64, xor64, shr64, get64} from '@aureooms/js-uint64';

export default function* splitmix64(seed) {
	let state = get64(...seed);
	while (true) {
		state = add64(state, get64(0x9e3779b9, 0x7f4a7c15));
		let z = state;
		z = mul64(xor64(z, shr64(z, 30)), get64(0xbf58476d, 0x1ce4e5b9));
		z = mul64(xor64(z, shr64(z, 27)), get64(0x94d049bb, 0x133111eb));
		yield* xor64(z, shr64(z, 31));
	}
}

import assert from 'assert';
import {rotl64, get64, add64, xor64, shl64} from '@aureooms/js-uint64';

export default function xoroshiro128plus(seed, options) {
	return new XoRoShiRo128Plus(seed, options);
}

class XoRoShiRo128Plus {
	constructor(seed, {a, b, c, JUMP}) {
		this.a = a || 24;
		this.b = b || 16;
		this.c = c || 37;
		this.JUMP = JUMP || [0xd8f554a5, 0xdf900294, 0x4b3201fc, 0x170865df];
		this.p = 0;
		this.z = 0;
		this.s0 = get64(seed[0], seed[1]);
		this.s1 = get64(seed[2], seed[3]);
	}

	next() {
		if (this.p === 0) {
			this.p = 1;
			const [value, z] = add64(this.s0, this.s1);
			this.z = z;
			return {value, done: false};
		}

		this.p = 0;
		const s0 = this.s0;
		const s1 = xor64(s0, this.s1);
		this.s0 = xor64(rotl64(s0, this.a), xor64(s1, shl64(s1, this.b)));
		this.s1 = rotl64(s1, this.c);
		return {value: this.z, done: false};
	}

	/**
	 * This is the jump function for the generator. It is equivalent
	 * to 2^64 calls to next(); it can be used to generate 2^64
	 * non-overlapping subsequences for parallel computations.
	 */
	jump() {
		assert(this.p === 0);

		let s0 = get64(0, 0);
		let s1 = get64(0, 0);

		for (const jump of this.JUMP) {
			for (let b = 0; b < 32; ++b) {
				if (jump & (1 << b)) {
					s0 = xor64(s0, this.s0);
					s1 = xor64(s1, this.s1);
				}

				this.next();
				this.next();
			}
		}

		this.s0 = s0;
		this.s1 = s1;
	}
}

